import { Box } from "@material-ui/core";
import React, { Component } from "react";
import "./App.css";
import background from "./assets/better_banner_bckg_2.png";
import banner from "./assets/better_banner_2.png";
/* import { makeStyles, createStyles, createTheme } from '@material-ui/core/styles'; */

function Banner() {
    return (
        <div>
            <Box
                style={{
                    position: "absolute",
                    top: 0,
                    width: "100%",
                    height: "339px",
                    backgroundImage: `url(${background})`,
                    backgroundRepeat: 'repeat',
                    filter: 'blur(8px)',
                    backgroundSize: 'auto',
                }}
            >

            </Box>

            <Box
                style={{
                    position: 'relative',
                    top: 0,
                    left: 'auto',
                    right: 'auto',
                    width: "1000px",
                    height: "339px",
                    backgroundImage: `url(${banner})`,
                    backgroundRepeat: "round",
                    margin: "auto",
                }}
            >
                <Box
                    color='primary.contrastText'
                    style={{
                        padding: 10,
                        textAlign: "right",
                        /* border: '2px solid black' */
                    }}
                >
                    <p>+38(000)000-000</p>
                    <p>shyaldomrii@knu.ua</p>
                </Box>
            </Box>
        </div>
    );
}

export default Banner;
